import * as React from 'react';
import './index.css';
import Button from '@mui/material/Button';
import AddBtn from '@mui/icons-material/Add';

const App = ()=> {
  return (
    <>

      <div className='main_div'>
        <div className='center_div'>
          <br/>
            <h1>ToDo List</h1>
          <br/>

          <input 
            type='text'
            placeholder='Enter List Item'
          />
           <Button>
              <AddBtn/>
           </Button>
        </div>
      </div>

    </>
  );
}

export default  App;
